"use strict";angular.module("app").factory("SweetAlert",function(){return{swal:function(){return window.swal.apply(window.swal,arguments)},success:function(n,r){return this.swal(n,r,"success")},error:function(n,r){return this.swal(n,r,"error")},warning:function(n,r){return this.swal(n,r,"warning")},info:function(n,r){return this.swal(n,r,"info")},close:function(){return window.swal.close()}}});